const notes = [
  { key: 1, title: "Note One", content: "This is the first note." },
  { key: 2, title: "Note Two", content: "Here goes the second note." },
  { key: 3, title: "Note Three", content: "Another insightful note." },
  { key: 4, title: "Note Four", content: "This is the fourth note." }
];

export default notes;
